import './dashboard.css'
import poker from '../assets/'
const Dashboard = () => {
    return (
      <div>
        
        <h2 >most popular</h2>
        <div>
            <div>
                <img src={poker} />
            </div>
        </div>
      </div>
    );
  };
  
  export default Dashboard;
